## Answer (1)

You can use the `style` property to set the background color of the card. Here is an example:

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "#000000"
  }
}
```

